//var input = ["", "", "", "", ""];
var input = ["ULL", "RRDDD", "LURDL", "UUUUD"];
var keypad = [
	["", "", "1", "", ""],
	["", "2", "3", "4", ""],
	["5", "6", "7", "8", "9"],
	["", "A", "B", "C", ""],
	["", "", "D", "", ""],
];

var row = 2, col = 0,
		result = "",
		current;

function figureOut() {
	for (var i = 0; i < input.length; i++) {
		current = input[i].split('');
		for (var j = 0; j < current.length; j++)
			switch (current[j]) {
				case 'U': if (row - 1 >= 0 && keypad[row - 1][col] != "") row--; break;
				case 'D': if (row + 1 < 5 && keypad[row + 1][col] != "") row++; break;
				case 'R': if (col + 1 < 5 && keypad[row][col + 1] != "") col++; break;
				case 'L': if (col - 1 >= 0 && keypad[row][col - 1] != "") col--; break;
			}

		result += keypad[row][col];
	}
}

function run() {
	figureOut();
	console.log(result);
}

run();




